INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (130211, 0.0, 1, 100, "フブキ", "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 0.0, 3002, "2030/01/01 14:59:59", -416.5, 1, 3002100, "2024/10/31 12:00:00");
