INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (130211, 0.0, 7, 301, "フブキ", "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", 0.0, 3005, "2030/01/01 14:59:59", -416.5, 7, 3002400, "2024/10/31 12:00:00");
